import React from 'react';

class BackButton extends React.Component{

    nextPath=(path)=>{
        this.props.history.push(path);
    }
    render(){
     return(
        <div>
            <button 
                style={{marginTop:"50px" }}
                className="ui button"
                onClick={()=>this.nextPath('/')}>
                    Back
            </button>   
        </div>
     )
    }

}

export default BackButton;
